ent/uploads/2016/06/about-274x300.jpg\" alt=\"about\" width=\"154\" height=\"169\" />\r\n\r\n<a href=\"http://wordpress.karmanya.co.in/?page_id=10\"><span style=\"text-decoration: underline;\"><em><strong>About Company</strong></em></span></a>\r\n\r\nKarmanya is born out of \"Karma\" which means the sum of a person\'s actions in this and previous states of existence, affecting future fate and destiny. At Karmanya we believe in actions that have long lasting results which benefits all our stakeholders - Customer, Team, Investor and Society.\r\n\r\nAt Karmanya, our focus is on small and medium sized businesses who are interested to implement IT solutions but cannot afford the high cost. Our missing behind starting this company is to provide world class solutions at an affordable price, capital as well as operational. Karmanya’s founders have rich and varied experience in working with Global Fortune 500 clients and they have been using this experience and knowledge to make IT solutions affordable and effective for all our clients.\r\n\r\n&nbsp;\r\n\r\n&nbsp;','About Us','','publish','closed','closed','','about-us','','','2016-06-10 13:29:40','2016-06-10 13:29:40','',0,'http://wordpress.karmanya.co.in/?page_id=10',0,'page','',0),(11,1,'2016-06-10 10:00:41','2016-06-10 10:00:41','','About Us','','inherit','closed','closed','','10-revision-v1','','','2016-06-10 10:00:41','2016-06-10 10:00:41','',10,'http://wordpress.karmanya.co.in/?p=11',0,'revision','',0),(12,1,'2016-06-10 10:00:53','2016-06-10 10:00:53','<img class=\"alignnone size-full wp-image-52\" src=\"http://wordpress.karmanya.co.in/wp-content/uploads/2016/06/img0006.png\" alt=\"img0006\" width=\"254\" height=\"141\" />\r\n\r\n<span style=\"text-decoration: underline;\"><a href=\"http://wordpress.karmanya.co.in/?page_id=12\"><em><strong>Contact Us</strong></em></a></span>\r\n\r\nIIIT Compus, Gachibouli, Hyderabad, Telangana.\r\n<div class=\"phone-no\"><strong>Phone:</strong> 9989975329.</div>','Contact','','publish